import React from 'react';

const MySelectOne = ({options, defaultValue}) => {
    return (
        <select>
            <option disabled='true' value="">{defaultValue}</option>
            {options.map(options =>
                <option key={options.value} value={options.value}>
                    {options.name}
                </option>
            )}
        </select>
    );
};

export default MySelectOne;
